column8:
カメリアで上品セレブにヘアアレンジ！ハーフアップやサイドテールなど、アレンジ次第で色んな表情に大変身♪♪<br><br> 
お呼ばれなどの華やかなシーンはもちろん、オフィスやカジュアルスタイルにもgood！ <br><br>
世代を問わず楽しめるモチーフだから、ぜひ一つは持っておきたいお勧めのアイテムです。
プレゼントにも喜ばれる♪<br><br>
■サイズ/全体約14ｃｍ×12ｃｍ　クリップ部分約5.5×2ｃｍ
<br><br>
日本製<br><br>
[ご留意事項]
